import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import classnames from "classnames";

import { getUsers, deleteUser } from "../../actions/userActions";

import Users from ".Users";

class DashUsers extends Component {
    componentDidMount() {
      console.log("Entra al did mount");
        console.log(this.props.getUsers());
        this.props.getUsers();
      }

    render() {
      console.log("Render")
        const { users, usersLoading } = this.props.users;

        let dashboardContent;

        if (users === null || usersLoading) {
            dashboardContent = <p className="center-align">Loading...</p>;
          } else if (users.length > 0) {
            // User has users linked
            dashboardContent = <Users users={users} />;
          } else {
            dashboardContent = <p className="center-align">No hay usuarios</p>;
          }

        return (
            <div className="container">
                {dashboardContent}}
            </div>
        )
    }
}

DashUsers.propTypes = {
    getUsers: PropTypes.func.isRequired,
    users: PropTypes.object.isRequired
}

const mapStateToProps = state => ({
    users: state.users
});

export  default connect(
    mapStateToProps,
    {getUsers}
) (DashUsers);
